using namespace std;

struct TreeNode {
    int val;
    TreeNode *left;
    TreeNode *right;
    TreeNode(int x) : val(x), left(NULL), right(NULL) {}
};

struct TreeNodeWithState {
    TreeNode* node;
    bool left_visited;
    bool right_visited;
    
    TreeNodeWithState(TreeNode* n) : node(n), left_visited(false), right_visited(false)  {}
};

int treeDepth(TreeNode* root)
{
  if (! root)
    return 0;

  int ldepth = treeDepth(root->left);
  int rdepth = treeDepth(root->right);
  return 1 + (ldepth > rdepth ? ldepth : rdepth);
} 

#define null 0
TreeNode* generateTree(vector<int>& nums, int idx)
{
    if (nums.empty() || idx >= (int)nums.size() || nums[idx] == null)
        return NULL;

    TreeNode* node = new TreeNode(nums[idx]);
    // std::cout << "idx:" << idx << ",val:" << node->val << std::endl;
    node->left = generateTree(nums, idx*2+1);
    node->right = generateTree(nums, idx*2+2);
    return node;
}

struct ShowTreeInfo
{
    int y;
    int x;
    TreeNode* node;
};

#define FIELDSIZE 2
void showTree(TreeNode* root)
{
  assert(root != NULL);

  // generate table
  int depth = treeDepth(root);
  string line;
  int width = (1<<depth) - 1;
  for (int i=0; i<width; i++)
    line.append(string(FIELDSIZE, ' '));
  vector<string> table(depth*2-1, line);

  char d_format[8];
  char s_format[8];
  sprintf(d_format, "%%-%dd", FIELDSIZE);
  sprintf(s_format, "%%-%ds", FIELDSIZE);

  queue<ShowTreeInfo> node_queue;
  ShowTreeInfo sinfo, tmp;
  sinfo.y = 1;
  sinfo.x = (width+1)/2;
  sinfo.node = root;
  node_queue.push(sinfo);
  while (! node_queue.empty())
  {
    tmp = node_queue.front();
    node_queue.pop();

    char buf[8];
    sprintf(buf, d_format, tmp.node->val);
    table[tmp.y-1].replace(FIELDSIZE*(tmp.x-1), FIELDSIZE, buf);

    if (tmp.node->left)
    {
      ShowTreeInfo linfo;
      linfo.y= tmp.y + 2;
      linfo.x = tmp.x - (1 << (depth - (linfo.y+1)/2));
      linfo.node = tmp.node->left;
      node_queue.push(linfo);

      sprintf(buf, s_format, "/");
      table[tmp.y].replace(FIELDSIZE*(tmp.x-2), FIELDSIZE, buf);
    }

    if (tmp.node->right)
    {
      ShowTreeInfo rinfo;
      rinfo.y = tmp.y + 2;
      rinfo.x = tmp.x + (1 << (depth - (rinfo.y+1)/2));
      rinfo.node = tmp.node->right;
      node_queue.push(rinfo);

      sprintf(buf, s_format, "\\");
      table[tmp.y].replace(FIELDSIZE*tmp.x, FIELDSIZE, buf);
    }
  }

  for (auto it=table.begin(); it!=table.end(); ++it)
    std::cout << *it << std::endl;
}

class Solution {
public:
    int countNodes(TreeNode* root) {
        if (root == NULL) {
            return 0;
        }
        
        int h = 0;
        TreeNode* curr = root;
        while (curr != NULL) {
            h++;
            curr = curr->left;
        }

        int ret = 1;
        int ch = 1;
        curr = root;
        std::stack<TreeNodeWithState> st;
        while (ch < h) {
            std::cout << curr->val << std::endl;
            st.push(TreeNodeWithState(curr));
            while (! st.empty()) {
                auto& tmp = st.top();
                if (! tmp.right_visited && tmp.node->right != NULL) {
                    tmp.right_visited = true;
                    curr = tmp.node->right;
                    ++ch;
                    ret = 2*ret + 1;
                    break;
                }
                if (! tmp.left_visited && tmp.node->left != NULL) {
                    tmp.left_visited = true;
                    curr = tmp.node->left;
                    ++ch;
                    ret = 2*ret;
                    break;
                }
                st.pop();
                ch--;
                ret /= 2;
            }
        }
        return ret;
    }
};

